import React, { useEffect } from "react";
import RestorentCard from "./RestorentCard";
import { Link } from 'react-router-dom'
import { useState } from 'react';




const Body = () => {


    const [listRs, setlistRS] = useState([

    ]);

    const [listRs1, setlistRS1] = useState([

    ]);

    useEffect(() => {
        fetchData();
    },
        [])
    const fetchData = async () => {
        const response = await fetch("https://www.swiggy.com/dapi/restaurants/list/v5?lat=17.2881543&lng=78.53485069999999&is-seo-homepage-enabled=true&page_type=DESKTOP_WEB_LISTING");
        const jsons = await response.json();
       // console.log("data" ,jsons);
        //console.log(jsons.data.cards[3].card.card.gridElements.infoWithStyle.restaurants);
        //setlistRS(jsons.data.cards[3].card.card.title);
        //console.log(jsons.data.cards[2].card.card.gridElements);
        //setlistRS(jsons.data.cards[2].card.card);
        setlistRS(jsons.data.cards[4].card.card.gridElements.infoWithStyle.restaurants);
    };



    const [searchTxt, setsearchTxt] = useState([]);
    return (
        <div className="body">
            <div className="searchBtn"><input type="text" value={searchTxt}
                onChange={(e) => {
                    setsearchTxt(e.target.value)
                }} className="btntext" />
                <button className="border" onClick={() => {
                    console.log(searchTxt);
                    const filterRs = listRs.filter((res) => res.info.name.toLowerCase().includes(searchTxt.toLowerCase())
                    );
                    setlistRS1(filterRs);
                }}>search</button></div>
            <div className="search">
                <button className="filter-btn" onClick={() => {

                    const FilterList = listRs.filter(
                        (res) => res.info.avgRating > 4
                    );
                    setlistRS(FilterList);
                    // console.log(FilterList);
                }}>Filter</button>

            </div>
            <div className="res-container">

            </div>
            <div className="res-container flex flex-wrap">

                {
                    searchTxt && listRs1?.length > 0 ? listRs1.map(
                        restorent => (
                            <Link to={"/restorents/" + restorent.info.id} key={restorent.info.id}>
                                <RestorentCard resData={restorent} />
                            </Link>
                        )
                    ) : listRs.map(restorent => (
                        // <a href="/restorents/229598"><RestorentCard resData={restorent} /></a>

                        <Link to={"/restorents/" + restorent.info.id} key={restorent.info.id}>
                            <RestorentCard resData={restorent} />
                        </Link>
                        // <RestorentCard id={restorent.info.id} resData={restorent} />

                    ))
                }


            </div>

        </div>
    );
}
export default Body;
